const SectionHead = ({ title, top }) => {
  const sectionTopStart = top ? `<div className="section-top">` : "";
  const sectionTopEnd = top ? `</div>` : "";

  return (
    <>
      {sectionTopStart}
      <div className="section-head">
        <div className="section-title">
          <h3>{title}</h3>
        </div>
      </div>
      {sectionTopEnd}
    </>
  );
};

export default SectionHead;
